<html lang="en">

<head>
  <style type="text/css">
    body {
      background: linear-gradient(-45deg, #146DD1, #04D294, #FF9C05, #FF5C05);
      background-size: 400% 400%;
      animation: gradient 5s ease infinite;
    }

    @keyframes gradient {
      0% {
        background-position: 0% 50%;
      }

      50% {
        background-position: 100% 50%;
      }

      100% {
        background-position: 0% 50%;
      }
    }

    .container {
      position: absolute;
      max-width: 100%;
      max-height: 100%;
    }

    .fullScreen {
      max-width: 100%;
      max-height: 100%;
    }

    .item {
      color: white;
      background: linear-gradient(-45deg, #146DD1, #04D294, #FF9C05, #FF5C05);
      background-size: 400% 400%;
      animation: gradient 5s ease infinite;
      border-radius: 100px 0;
      width: fit-content;
      padding: 0 60px;
      position: absolute;
      top: 25px;
      left: 110px;
      z-index: 1;
      transform: rotate(357deg);
    }

    .icon {
      position: absolute;
      max-width: 50%;
      max-height: 50%;
      z-index: 2;
      bottom: 120px;
      left: 40px;
      border-radius: 199px;
    }

    .grid-container {
      position: absolute;
      display: grid;
      grid-template: 60px 60px / 60px 60px;
      gap: 10px;
      z-index: 3;
      bottom: 260px;
      left: 170px;
    }

    .dot {
      background-color: white;
      border-radius: 30px;
    }
  </style>
</head>
